import { NextApiRequest, NextApiResponse } from "next";
import { Template, BLANK_PDF, generate } from "@pdfme/generator";
import fs from "fs";
import * as path from "path";

export default async function handler(
  req: NextApiRequest,
  res: NextApiResponse,
) {
  const templateValues = req.body;
  const template = {
    schemas: [
      {
        title: {
          type: "text",
          position: {
            x: 69.59,
            y: 41.01,
          },
          width: 127.6,
          height: 7,
          alignment: "left",
          fontSize: 20,
          characterSpacing: 0,
          lineHeight: 1,
          fontName: "Roboto",
        },
        promoter: {
          type: "text",
          position: {
            x: 47.89,
            y: 72.77,
          },
          width: 76.27,
          height: 7,
          alignment: "left",
          fontSize: 12,
          characterSpacing: 0,
          lineHeight: 1,
          fontName: "Roboto",
        },
        date: {
          type: "text",
          position: {
            x: 36.25,
            y: 84.13,
          },
          width: 55.11,
          height: 7,
          alignment: "left",
          fontSize: 12,
          characterSpacing: 0,
          lineHeight: 1,
          fontName: "Roboto",
        },
        description: {
          type: "text",
          position: {
            x: 48.95,
            y: 94.72,
          },
          width: 129.19,
          height: 51.18,
          alignment: "left",
          fontSize: 12,
          characterSpacing: 0,
          lineHeight: 1,
          fontName: "Roboto",
        },
      },
    ],
    basePdf:
      "data:application/pdf;base64,",
  };
  const inputs = [
    {
      title: templateValues.title,
      promoter: templateValues.promoter,
      date: templateValues.date,
      description: templateValues.description,
    },
  ];

  generate({ template, inputs }).then((pdf) => {
    // Browser
    // const blob = new Blob([pdf.buffer], { type: 'application/pdf' });
    // window.open(URL.createObjectURL(blob));

    // Node.js
    fs.writeFileSync(path.join(__dirname, `test1.pdf`), pdf);
  });
  res.status(200);
  res.json({ data: "PDF generated" });
  res.end();
}
